package org.apache.commons.text;

import org.apache.commons.text.RandomStringGenerator;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class RandomStringGeneratorTest1 {

    @Test
    public void testRandomStringGeneratorOverrideConfiguration() {
        // Establish a generator configuration that restricts output to lowercase letters between 'a' and 'z'
        RandomStringGenerator.Builder initial_config = RandomStringGenerator.builder();

        // Apply an initial filtering rule to the generator configuration
        RandomStringGenerator.Builder configured_generator = initial_config.filteredBy(org.apache.commons.text.CharacterPredicates.LETTERS);

        // Replace the filtering rule with an alternative criterion that permits only the character 'b'
        RandomStringGenerator.Builder updated_generator = configured_generator.selectFrom(new char[]{'b'});

        // Finalize the configuration
        RandomStringGenerator finalized_generator = updated_generator.get();

        // Generate a text sequence of one hundred characters
        String generated_text = finalized_generator.generate(100);

        // Examine each individual character in the resulting text and confirm that every character matches the expected value of 'b'
        for (int i = 0; i < generated_text.length(); i++) {
            char c = generated_text.charAt(i);
            assertEquals('b', c, "All characters should be 'b'");
        }

        // Additional validation to ensure the entire string contains only 'b' characters
        assertEquals(100, generated_text.length(), "Generated string should have exactly 100 characters");
        assertTrue(generated_text.matches("b{100}"), "Generated string should contain only 'b' characters");
    }
}

package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class RandomStringGeneratorFilterTest {

    // Define two static character predicate constants
    private static final CharacterPredicate first_predicate = ch -> ch == 'a';
    private static final CharacterPredicate second_predicate = ch -> ch == 'b';

    @Test
    public void testFilterReplacement() {
        // Obtain a builder instance from the Random String Generator
        RandomStringGenerator.Builder builder = RandomStringGenerator.builder();

        // Configure the builder to generate characters within the lowercase alphabetic range from a to z
        RandomStringGenerator.Builder configured_builder = builder.withinRange(97, 122);

        // Apply the first character predicate filter to restrict output to characters matching that predicate
        RandomStringGenerator.Builder filtered_builder = configured_builder.filteredBy(first_predicate);

        // Invoke the filter replacement method on the builder with the second character predicate
        RandomStringGenerator.Builder replaced_builder = filtered_builder.filteredBy(second_predicate);

        // Build the generator instance
        RandomStringGenerator generator = replaced_builder.build();

        // Invoke the generation method to produce a string of one hundred characters
        String generated_string = generator.generate(100);

        // Convert the generated string to a character array
        char[] char_array = generated_string.toCharArray();

        // Iterate through each character in the array
        // Assert that every character equals b
        for (char c : char_array) {
            assertEquals('b', c, "Every character should be 'b'");
        }
    }
}

