package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import java.util.Arrays;
import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.junit.jupiter.api.Assertions.assertNotNull;

public class RandomStringGeneratorTest1 {

    @Test
    public void testRandomStringGeneratorWithMultipleRangesAndPunctuation() {
        // Step 0: Construct a sorted character array containing specific punctuation symbols
        char[] punctuationArray = {'!', '"', '#', '$', '%', '&', '\'', '(', ')', '*', '+', ',', '-', '.', '/', ':', ';', '<', '=', '>', '?', '@', '[', '\\', ']', '^', '_', '`', '{', '|', '}', '~'};
        Arrays.sort(punctuationArray);

        // Step 1: Build a Random String Generator instance using its builder interface
        RandomStringGenerator.Builder generatorBuilder = RandomStringGenerator.builder();

        // Step 2: Enable accumulation mode on the generator builder
        RandomStringGenerator.Builder configuredBuilder = generatorBuilder.setAccumulate(true);

        // Step 3: Specify three alphanumeric ranges covering lowercase letters, uppercase letters, and digits
        configuredBuilder.withinRange(97, 122);  // lowercase letters (a-z)
        configuredBuilder.withinRange(65, 90);   // uppercase letters (A-Z)
        configuredBuilder.withinRange(48, 57);   // digits (0-9)

        // Step 4: Select from the punctuation array as an additional source
        RandomStringGenerator.Builder finalBuilder = configuredBuilder.selectFrom(punctuationArray);

        // Step 5: Generate a random string of fixed length using the configured generator
        RandomStringGenerator generator = finalBuilder.build();
        String randomString = generator.generate(10);

        // Assertions
        assertNotNull(randomString);
        assertTrue(randomString.length() == 10);

        // Step 6: Iterate through each character in the resulting string
        for (char c : randomString.toCharArray()) {
            // Step 7 & 8: Validate that every character satisfies at least one of the configured constraints
            // Check if it's a letter or digit
            boolean isLetterOrDigit = Character.isLetterOrDigit(c);

            // Check if it's in the punctuation array using binary search
            boolean isInPunctuation = Arrays.binarySearch(punctuationArray, c) >= 0;

            // Verify that the character satisfies at least one constraint
            assertTrue(isLetterOrDigit || isInPunctuation, 
                "Character '" + c + "' is neither a letter/digit nor in the punctuation array");
        }
    }
}

