package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class RandomStringGeneratorTest1 {

    @Test
    public void testAccumulationBehavior() {
        // Test Case 1: Test accumulation enabled
        // Given: Configure the text generator with a reference character set of five specific characters
        RandomStringGenerator.Builder builder1 = RandomStringGenerator.builder();
        builder1.selectFrom(new char[]{'a', 'b', 'c', 'd', 'e'});

        // Apply successive configurations narrowing character options to subsets of four, three, and two characters
        builder1.selectFrom(new char[]{'a', 'b', 'c', 'd'});

        // Apply configurations that provide no characters
        builder1.selectFrom(new char[]{});

        // When: Enable accumulation behavior
        builder1.setAccumulate(true);

        // Instruct the system to produce a random text output of ten characters
        RandomStringGenerator generator1 = builder1.get();

        // Generate the random text of ten characters
        String generatedTextWithAccumulation = generator1.generate(10);

        // Then: Verify every character in the generated text appears within the original reference set
        String referenceSet = "abcd"; // Only the accumulated characters from previous steps
        for (char c : generatedTextWithAccumulation.toCharArray()) {
            assertTrue(referenceSet.indexOf(c) >= 0, 
                "Character '" + c + "' should be in the reference set '" + referenceSet + "'");
        }

        // Test Case 2: Test accumulation disabled
        // Given: Configure the text generator with a reference character set of five specific characters
        RandomStringGenerator.Builder builder2 = RandomStringGenerator.builder();
        builder2.selectFrom(new char[]{'a', 'b', 'c', 'd', 'e'});

        // Apply successive configurations narrowing character options to subsets of four, three, and two characters
        builder2.selectFrom(new char[]{'f', 'g', 'h', 'i'});

        // Apply configurations that provide no characters
        builder2.selectFrom(new char[]{});

        // When: Disable accumulation behavior
        builder2.setAccumulate(false);

        // Instruct the system to produce a random text output of ten characters
        RandomStringGenerator generator2 = builder2.get();

        // Generate the random text of ten characters
        String generatedTextWithoutAccumulation = generator2.generate(10);

        // Then: Verify no character from the original reference set is present in the generated text
        // When accumulation is disabled, only the last configuration matters
        // Since the last configuration was empty, we expect the generator to use some default behavior
        // Let's check that none of our specifically configured characters appear
        String configuredChars = "abcdefghi"; // All characters we explicitly configured
        for (char c : generatedTextWithoutAccumulation.toCharArray()) {
            assertFalse(configuredChars.indexOf(c) >= 0, 
                "Character '" + c + "' should NOT be from our configured set '" + configuredChars + "'");
        }

        // Test Case 3: Test corrected accumulation
        // Given: Create a new text generator instance
        RandomStringGenerator.Builder builder3 = RandomStringGenerator.builder();

        // Configure with empty character set first
        builder3.selectFrom(new char[]{});

        // When: Enable accumulation and add characters
        builder3.setAccumulate(true);

        // Add the reference character set
        builder3.selectFrom(new char[]{'a', 'b', 'c', 'd', 'e'});

        // Build the generator
        RandomStringGenerator generator3 = builder3.get();

        // Generate the random text of ten characters
        String generatedTextCorrected = generator3.generate(10);

        // Then: Verify every character in the generated text appears within the reference set
        String referenceSetV3 = "abcde";
        for (char c : generatedTextCorrected.toCharArray()) {
            assertTrue(referenceSetV3.indexOf(c) >= 0, 
                "Character '" + c + "' should be in the reference set '" + referenceSetV3 + "'");
        }
    }
}

package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.ValueSource;
import static org.junit.jupiter.api.Assertions.*;

public class RandomStringGeneratorTest1 {

    @ParameterizedTest
    @ValueSource(booleans = {true, false})
    void testAccumulationBehavior(boolean accumulationFlag) {
        // Construct a reference string containing five sequential lowercase characters
        String referenceString = "abcde";

        // Build a Random String Generator using a fluent builder interface
        RandomStringGenerator.Builder builder = RandomStringGenerator.builder();

        // Set the accumulation mode to the provided parameter value
        builder = builder.setAccumulate(accumulationFlag);

        // Chain multiple calls to register character selection ranges with progressively 
        // decreasing character sets starting from all five reference characters down to two characters
        builder = builder.selectFrom(referenceString.toCharArray()); // All 5 characters: a,b,c,d,e
        builder = builder.selectFrom("abcd".toCharArray());         // 4 characters: a,b,c,d
        builder = builder.selectFrom("abc".toCharArray());          // 3 characters: a,b,c
        builder = builder.selectFrom("ab".toCharArray());           // 2 characters: a,b

        // Include calls with null and empty arguments to verify robustness
        builder = builder.selectFrom(null);                         // null argument
        builder = builder.selectFrom("".toCharArray());             // empty argument

        // Finalize the generator instance
        RandomStringGenerator randomStringGenerator = builder.build();

        // Invoke the generator's text production method to create a ten-character random string
        String generatedString = randomStringGenerator.generate(10);

        System.out.println("Accumulation flag: " + accumulationFlag);
        System.out.println("Generated string: " + generatedString);

        // Iterate through each character in the generated output and assert based on accumulation mode
        if (accumulationFlag) {
            // When accumulation is enabled, all characters in the generated string should be from the reference string
            for (char c : generatedString.toCharArray()) {
                assertTrue(referenceString.indexOf(c) >= 0, 
                    "Character '" + c + "' should be in reference string when accumulation is enabled");
            }
        } else {
            // When accumulation is disabled, only the last non-null selectFrom call determines the character set
            // The last non-null selectFrom call was with "ab", so all characters should be either 'a' or 'b'
            for (char c : generatedString.toCharArray()) {
                assertTrue(c == 'a' || c == 'b', 
                    "Character '" + c + "' should be either 'a' or 'b' when accumulation is disabled");
            }
        }
    }
}

