package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

import java.util.HashMap;
import java.util.Map;

public class StringSubstitutorCircularReferenceTest {

    @Test
    public void testCircularReferenceDetection() {
        // Step 0: Prepare a configuration with a self-referential variable named "name" 
        // whose value contains the placeholder "<name>"
        Map<String, String> configWithCircularRef = new HashMap<>();
        configWithCircularRef.put("name", "<name>"); // Self-referential variable

        // Step 1: Set custom delimiters to angle brackets for variable substitution
        StringSubstitutor substitutor = new StringSubstitutor(configWithCircularRef);
        substitutor.setVariablePrefix('<');
        substitutor.setVariableSuffix('>');

        // Enable substitution in variables to detect circular references
        substitutor.setEnableSubstitutionInVariables(true);

        // Step 2: Attempt to perform text substitution on a greeting message 
        // containing the self-referential variable
        String source = "Hello <name>!";

        // Step 3 & 4: Verify that the system raises an IllegalStateException 
        // indicating an illegal state due to circular reference
        IllegalStateException exception = assertThrows(IllegalStateException.class, () -> {
            substitutor.replace(source);
        });

        // Confirm that the error message indicates infinite loop in property interpolation
        assertTrue(exception.getMessage().contains("Infinite loop in property interpolation"));
    }
}

