package org.apache.commons.text;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;
import static org.assertj.core.api.Assertions.*;

class TextCompositionSystemTest {

    @Test
    void testTextCompositionInsertionAtEndPositionWithBoundaryProtection() {
        // Setup
        TextStringBuilder text_composition = new TextStringBuilder();
        assertTrue(text_composition.isEmpty(), "Initial state should be empty");

        // Given: Insert a text segment at the start position
        String valid_input = "Hello";
        text_composition.insert(0, valid_input);

        // Then: Verify the content matches the expected text
        assertEquals("Hello", text_composition.toString());

        // Given: Attempt to insert content at a position before the valid range
        int invalid_position_before = -1;
        Exception exception1 = assertThrows(StringIndexOutOfBoundsException.class, () -> {
            text_composition.insert(invalid_position_before, valid_input);
        });

        // Given: Attempt to insert content beyond the current end boundary
        int invalid_position_beyond = text_composition.size() + 1;
        Exception exception2 = assertThrows(StringIndexOutOfBoundsException.class, () -> {
            text_composition.insert(invalid_position_beyond, valid_input);
        });

        // Given: Insert a boolean value at the current end position
        boolean boolean_value = true;
        text_composition.insert(text_composition.size(), boolean_value);

        // Then: Confirm the system appends the text representation of the boolean value
        assertEquals("Hellotrue", text_composition.toString());

        // Given: Attempt to insert content at positions outside the updated valid range
        int invalid_position_outside_updated_range = -2;
        Exception exception3 = assertThrows(StringIndexOutOfBoundsException.class, () -> {
            text_composition.insert(invalid_position_outside_updated_range, valid_input);
        });

        // Given: Insert a single character at the end
        char single_character = '!';
        text_composition.insert(text_composition.size(), single_character);

        // Then: Validate the updated content
        assertEquals("Hellotrue!", text_composition.toString());

        // Given: Insert a sequence of characters at the end position
        char[] character_sequence = {' ', 'W', 'o', 'r', 'l', 'd'};
        text_composition.insert(text_composition.size(), character_sequence);

        // Then: Confirm they appear in the output
        assertEquals("Hellotrue! World", text_composition.toString());

        // Given: Attempt to insert content at positions beyond the new boundary
        int invalid_position_beyond_new_boundary = text_composition.size() + 5;
        Exception exception4 = assertThrows(StringIndexOutOfBoundsException.class, () -> {
            text_composition.insert(invalid_position_beyond_new_boundary, valid_input);
        });

        // Given: Insert a portion of a character sequence by specifying a subset range
        char[] character_sequence_subset = {'-', 'T', 'e', 's', 't', '-'};
        int start_index = 1;
        int end_index = 5; // Will insert chars from index 1 to 4 (Tes)
        text_composition.insert(text_composition.size(), character_sequence_subset, start_index, end_index - start_index);

        // Then: Validate the correct segment appears in the composition
        assertEquals("Hellotrue! WorldTes", text_composition.toString());

