        // Step 1: System is configured with no custom separators (using space as delimiter to simulate default behavior)
        systemInstance.setDelimiterChar(' ');

        // Step 2: Tokenize test string with period using default configuration
        systemInstance.reset("word1.word2");
        List<String> periodTokensDefault = systemInstance.getTokenList();

        // Step 3: Tokenize test string with space using default configuration
        systemInstance.reset("word1 word2");
        List<String> spaceTokensDefault = systemInstance.getTokenList();

        // Step 4: Verify period is not recognized as a separator
        assertEquals(1, periodTokensDefault.size(), "Period should not act as separator with default configuration");
        assertEquals("word1.word2", periodTokensDefault.get(0), "Token should contain the whole string");

        // Step 5: Verify space is correctly identified as a separator
        assertEquals(2, spaceTokensDefault.size(), "Space should act as separator with default configuration");
        assertEquals("word1", spaceTokensDefault.get(0), "First token should be 'word1'");
