        // Step 9: Verify space is not treated as a separator
        assertEquals(1, spaceTokensPeriodOnly.size(), "Space should not act as separator when period is the only delimiter");
        assertEquals("word1 word2", spaceTokensPeriodOnly.get(0), "Token should contain the whole string");

        // Step 10: Verify period is now qualified as a separator
        assertEquals(2, periodTokensPeriodOnly.size(), "Period should act as separator when configured as delimiter");
        assertEquals("word1", periodTokensPeriodOnly.get(0), "First token should be 'word1'");
