class LevenshteinDistanceTest1 {

    private LevenshteinDistance configuredSystem;
    private static final int THRESHOLD = 5;

    @BeforeEach
    void setUp() {
        // Step 0: Configure the text similarity comparison system with a specific threshold limit
        configuredSystem = new LevenshteinDistance(THRESHOLD);
    }

    @Test
    void testLevenshteinDistanceWithThreshold() {
        // Step 1: Prepare a first text sequence and a second text sequence
        String firstText = "kitten";
        String secondText = "sitting";

        // Step 2: Measure the similarity between the first text sequence and the second text sequence
        Integer forwardDistance = configuredSystem.apply(firstText, secondText);

        // Step 3: Reverse the order of the text sequences
        String temp = firstText;
        firstText = secondText;
        secondText = temp;

        // Step 4: Measure the similarity between the second text sequence and the first text sequence
        Integer reverseDistance = configuredSystem.apply(firstText, secondText);

        // Step 5: Verify that both directional comparisons yield identical edit distance values
        assertEquals(forwardDistance, reverseDistance, 
            "Edit distance should be symmetric regardless of input order");

        // Step 6: Confirm that the calculated distances match the expected business outcome
        assertEquals(3, forwardDistance, 
            "Expected edit distance between 'kitten' and 'sitting' is 3");
        assertEquals(3, reverseDistance, 
            "Expected edit distance between 'sitting' and 'kitten' is 3");

        // Step 7: Verify that the similarity metric behaves symmetrically and respects the threshold boundary
        assertEquals(forwardDistance, reverseDistance, 
            "Symmetry check failed");
        assertTrue(forwardDistance <= configuredSystem.getThreshold(), 
            "Forward distance exceeds threshold");
        assertTrue(reverseDistance <= configuredSystem.getThreshold(), 
            "Reverse distance exceeds threshold");

        // Step 8: Prepare multiple input variations representing different text similarity scenarios
        String[][] textVariations = {
            {"hello", "hallo"},      // distance: 1
            {"world", "word"},       // distance: 1
            {"test", "tent"},        // distance: 2
            {"java", "jave"}         // distance: 1
        };

        // Step 9: Process each text variation pair through the similarity comparison system
        for (String[] textPair : textVariations) {
            Integer distance = configuredSystem.apply(textPair[0], textPair[1]);

            // Step 10: Validate that all comparison results respect the configured threshold boundary
            assertTrue(distance >= 0, 
                "Distance for pair (" + textPair[0] + ", " + textPair[1] + ") should be non-negative");
            assertTrue(distance <= configuredSystem.getThreshold(), 
                "Distance for pair (" + textPair[0] + ", " + textPair[1] + ") exceeds threshold");
        }

        // Step 11: Confirm that the system handles all expected text comparison patterns correctly
        // Verifying that we got results for all test cases
        assertEquals(4, textVariations.length, 
            "Should have processed 4 text variation pairs");

        // Testing edge cases
        assertEquals(0, configuredSystem.apply("same", "same"), 
            "Identical strings should have distance 0");
        assertEquals(4, configuredSystem.apply("", "test"), 
            "Empty string to 'test' should have distance 4");

        // Verify that distances above threshold are handled correctly
        // Using a distance that should exceed our threshold of 5
        Integer largeDistance = configuredSystem.apply("a", "abcdefghijk"); // distance 10
        // When distance exceeds threshold, it should return -1
        assertEquals(-1, largeDistance, 
            "Distance exceeding threshold should return -1");
    }
}

