import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

public class TextTransformationTest {

    @Test
    public void testCombinedTransformationWithInvocationTracking() {
        // Given: Establish three text transformation rules with invocation tracking
        TrackingTranslator rule1 = new TrackingTranslator("Rule1");
        TrackingTranslator rule2 = new TrackingTranslator("Rule2");
        TrackingTranslator rule3 = new TrackingTranslator("Rule3");

        // When: Combine three transformation rules into single unified transformation process
        CharSequenceTranslator combinedTransformation = CharSequenceTranslator.with(rule1, rule2, rule3);

        // Trigger combined transformation process with empty text input
        String transformationResult = combinedTransformation.translate("");

        // Then: Confirm combined transformation process uses appropriate aggregation strategy
        assertTrue(combinedTransformation instanceof CharSequenceTranslator.AggregateTranslator, 
                  "Combined transformation should be an AggregateTranslator");

        // Verify transformation rules were invoked through custom tracking mechanism
        assertEquals(1, rule1.getInvocationCount(), "Rule1 should be invoked exactly once");
        assertEquals(1, rule2.getInvocationCount(), "Rule2 should be invoked exactly once");
        assertEquals(1, rule3.getInvocationCount(), "Rule3 should be invoked exactly once");

        // Assert all transformation rules participated in the combined process
        assertEquals("", transformationResult, "Transformation result should be empty string");
    }

    /**
     * Custom implementation to simulate Apache Commons Text translators with invocation tracking
     */
    static abstract class CharSequenceTranslator {
        public abstract String translate(CharSequence input);

        public static CharSequenceTranslator with(CharSequenceTranslator... translators) {
            return new AggregateTranslator(translators);
        }

        static class AggregateTranslator extends CharSequenceTranslator {
            private final CharSequenceTranslator[] translators;

            public AggregateTranslator(CharSequenceTranslator... translators) {
                this.translators = translators;
            }

            @Override
            public String translate(CharSequence input) {
                String result = input.toString();
                for (CharSequenceTranslator translator : translators) {
                    result = translator.translate(result);
                }
                return result;
            }

            public CharSequenceTranslator[] getTranslators() {
                return translators;
            }
        }
    }

    /**
     * Custom tracking translator that counts invocations
     */
    static class TrackingTranslator extends CharSequenceTranslator {
        private int invocationCount = 0;
        private final String name;

        public TrackingTranslator(String name) {
            this.name = name;
        }

        @Override
        public String translate(CharSequence input) {
            invocationCount++;
            return input.toString(); // No actual transformation for this test
        }

        public int getInvocationCount() {
            return invocationCount;
        }

        public String getName() {
            return name;
        }
    }
}

